import MyIcon from "../media/moon-svgrepo-com.svg";

const Header = () => {
  return (
    <>
      <div className="header-wrapper">
        <div className="header-row">
          <MyIcon />
          <div>haha</div>
        </div>
      </div>
    </>
  );
};

